import React, { Component } from "react";

import Post from "./components/post.js";

class App extends Component {
  render() {
    return (
      <div>
        <h1>Minha rede social</h1>
        <Post text={"Texto Primeiro post"} time={"13:00"} />
        <Post text={"Texto segundo post"} time={"14:00"} />
        <Post text={"Texto terceiro post"} time={"15:00"} />
        <Post text={"Texto quarto post"} time={"16:00"} />
      </div>
    );
  }
}

export default App;
